import React, {Component} from 'react';
import './App.css';
import Header from '../Header/Header';
import Main from '../Main/Main';
import Footer from '../Footer/Footer';
import Background from "../../img/bground.jpg";

// import axios from "axios";

class App extends Component {

  // const []

  // componentDidMount = async () => {
  //   const response = await axios.get("https://api.teleport.org/api/urban_areas/slug:san-francisco-bay-area/scores/")
  //   console.log(response);
  // }

  render() {
    return (
      <div className="App" style={{ backgroundImage: "url(" + Background + ")", backGround: "cover" }}>
        <Header />
        <Main />
        <Footer />
      </div>
    );
  }
}

export default App;
